import {
    faInstagram,
    faTwitter,
    faFacebookSquare,
    faYoutube,
} from '@fortawesome/free-brand-svg-icons';

const Home = (props) => {

    return (

        <div>
        {/* Header */}
            <Navbar color="dark" dark expand="md">
                <Nav className="mr-auto">
                    <NavItem>
                        <NavLink href="#">Home</NavLink>
                    </NavItem>
                    <NavItem>
                        <NavLink href="#">Shop</NavLink>
                    </NavItem>
                    <NavItem>
                        <NavLink href="#">About</NavLink>
                    </NavItem>
                    <NavItem>
                        <NavLink href="#">Contact</NavLink>
                    </NavItem>
                </Nav>
            </Navbar>


        {/* Footer */}
            <Navbar color="dark" dark expand="md" className='footer'>
                {/* <FontAwesomeIcon icon={faFacebookSquare} color="#1777F2" />
                <FontAwesomeIcon icon={faTwitter} color="#33a7f4" />
                <FontAwesomeIcon icon={faInstagram} color="#CA5191" /> */}
                <FontAwesomeIcon icon={faCoffee} color="#e5162f" />
            </Navbar>
        </div>
    );
}

export default Home;
